text = ""


def most_common_5char_sequence(text):
    sequences = {}
    for i in range(len(text) - 4):
        seq = text[i : i + 5]
        if seq in sequences:
            sequences[seq] += 1
        else:
            sequences[seq] = 1

    most_common_seq = max(sequences, key=sequences.get)
    print(sequences)
    return most_common_seq


result = most_common_5char_sequence(text)
print("The most common 5-character sequence is:", result)
